								s += '<div class="percentbar", style="width:' + Math.min(100,oneLevel[i][9]/totals_CUMULATIVE[7] * 100) + '%;"></div>'
								s += '</span></div>'
								recurse(oneLevel[i][10], depth + 1, thisId)
								s += "</div>"
							}
						}
						var datas;
						if(mode_CUMULATIVE == "flat") {
							datas = Flatten_CUMULATIVE();
						}
						else {
							datas = datas_CUMULATIVE;
						}
						recurse(datas, 0, 0)
						s += '</div>'
						elem.innerHTML = s
						for(var i = 0; i < id; ++i) {
							className = 'CUMULATIVE_Parent_' + i
							elems = document.getElementsByClassName(className)
							for(var j = 0; j < elems.length; ++j) {
								var elem = elems[j]
								elem.style.maxHeight = Math.max(22, elem.clientHeight) + "px"
								elem.rememberMaxHeight = elem.style.maxHeight
							}
						}
						maxId_CUMULATIVE = id
					}

					function ExpandAll_CUMULATIVE() {
						for(var i = 1; i < maxId_CUMULATIVE; ++i) {
							className = 'CUMULATIVE_Parent_' + i
							elems = document.getElementsByClassName(className)
							arrowElem = document.getElementById("arrow_CUMULATIVE_"+i)
							for(var j = 0; j < elems.length; ++j) {
								var elem = elems[j]
								elem.style.maxHeight=elem.rememberMaxHeight
								arrowElem.innerHTML = '&#x25bc;'
							}
						}
						return false;
					}

					function CollapseAll_CUMULATIVE() {
						for(var i = 1; i < maxId_CUMULATIVE; ++i) {
							className = 'CUMULATIVE_Parent_' + i
							elems = document.getElementsByClassName(className)
							arrowElem = document.getElementById("arrow_CUMULATIVE_"+i)
							for(var j = 0; j < elems.length; ++j) {
								var elem = elems[j]
								elem.style.maxHeight='0px'
								arrowElem.innerHTML = '&#x25b6;'
							}
						}
						return false;
					}

					function RenderTreeView_CUMULATIVE() {
						if(mode_CUMULATIVE != "tree") {
							mode_CUMULATIVE = "tree";
							prevSortType_CUMULATIVE *= -1
							Populate_CUMULATIVE(prevSortKey_CUMULATIVE)
							elem = document.getElementById("expandcollapse_CUMULATIVE")
							elem.style.opacity = 100
							elem.style.visibility = "visible"
						}
						return false;
					}

					function RenderFlatView_CUMULATIVE() {
						if(mode_CUMULATIVE != "flat") {
							mode_CUMULATIVE = "flat";
							prevSortType_CUMULATIVE *= -1
							Populate_CUMULATIVE(prevSortKey_CUMULATIVE)
							elem = document.getElementById("expandcollapse_CUMULATIVE")
							elem.style.opacity = 0
							elem.style.visibility = "hidden"
						}
						return false;
					}
			</script>
			<div>
			<div style="border:1px solid black;padding:0px 6px">
				<div style="float:left;transition:opacity 0.5s, visibility 0.5s" id="expandcollapse_CUMULATIVE">
					<a href="javascript:;" onclick="ExpandAll_CUMULATIVE()">expand all</a> |
					<a href="javascript:;" onclick="CollapseAll_CUMULATIVE()">collapse all</a>
				</div>
				&nbsp;
				<div style="float:right">
					View as:
					<a href="javascript:;" onclick="RenderTreeView_CUMULATIVE()">tree</a> |
					<a href="javascript:;" onclick="RenderFlatView_CUMULATIVE()">flat</a>
				</div>
			</div>
			<div style="clear:left" id="stack_CUMULATIVE"></div>
			</div>
			<script type="text/javascript">
				Populate_CUMULATIVE(1);
				setTimeout(function() {
					var height = document.getElementsByTagName("html")[0].scrollHeight + 10;
					console.log("Set height to " + height)
					window.parent.postMessage(["setHeight", height], "*"); 
				}, 1000);
			</script>
		</div>
	</BODY>
</HTML>
